    @objc dynamic public class func imageOfWatcher(imageSize: CGSize = CGSize(width: 200, height: 200)) -> UIImage {
        UIGraphicsBeginImageContextWithOptions(imageSize, false, 0)
            Player.drawWatcher(frame: CGRect(x: 0, y: 0, width: imageSize.width, height: imageSize.height))

        let imageOfWatcher = UIGraphicsGetImageFromCurrentImageContext()!
        UIGraphicsEndImageContext()

        return imageOfWatcher
    }

